import React from 'react'
import data from '../data.json' ;


 function Product(props) {
     
  return (
    <div>
        {
            data.map((datum)=>{
                const {name, image, descpription} = props ;
                return(
                    <div>
                        <h3>{name}</h3>
                        <h4>{image}</h4>
                        <h4>{descpription}</h4>
                    </div>
                )
            })
        }
    </div>
  )
}

export default Product ;
